Identificativo di Licenza, essendo un identificativo unico globale per una licenza o contratto sotto il quale gli articoli sono generati, inviati per l'elaborazione e/o pagati, che è costruito concatenando:
 - un codice di emissione ISO/IEC 15459;
 - un numero di licenza o contratto che si accorda con le specifiche dell'agenzia di emissione interessata;
 e che:
 - comprende solo caratteri alfabetici maiuscoli e/o numerici;
 - è unico (cioè, è distinto da qualsiasi altro identificativo conforme a ISO/IEC 15459) all'interno del dominio dell'agenzia di emissione;
 - non può essere derivato da qualsiasi altro identificativo conforme a ISO/IEC 15459, emesso sotto la stessa agenzia di emissione, tramite l'aggiunta semplice di caratteri alla sua fine, o la loro rimozione.

Codice dell'area di pesca della FAO come definito dal Dipartimento di Pesca e Acquacoltura della FAO (http://www.fao.org. Cercare il sottosito del Codice dell'Area di Pesca).
Tutti i caratteri del sottoinsieme definito dalle Specifiche Generali GS1 di ISO/IEC 646 sono ammessi.
Esempi:
18L37.1.3 Mar Mediterraneo occidentale, Sardegna;
18L47.B.1 Atlantico, Sud-est, Divisione SEAFO, ZEE Namibia;
18L67 Pacifico, Nord-est.

'26L' Codice di Località, essendo un codice che identifica una località o area geografica, o un gruppo associato di tali località o aree, che ha rilevanza per una transazione correlata e che si conforma a una delle strutture definite in (a) a (f) di seguito:
a) due caratteri alfabetici maiuscoli corrispondenti al codice di paese ISO 3166-1 a due caratteri alfa del paese in cui, o costituito da, le località o aree sono situate;
b) tre caratteri alfabetici maiuscoli corrispondenti al codice IATA dell'aeroporto o della città in, vicino a, o costituito da, le località o aree sono situate;
c) quattro o più caratteri dei quali i primi tre corrispondono a un codice di paese ISO 3166-1 seguito da un trattino (-), con il saldo essendo un codice postale nel paese interessato;
d) quattro o più caratteri dei quali i primi tre corrispondono a un codice di paese ISO 3166-1 seguito da un punto (.), con il saldo essendo un codice di suddivisione di paese ISO 3166-2 nel paese interessato;
e) cinque caratteri alfabetici maiuscoli corrispondenti al codice UN/LOCODE dell'area in, vicino a, o costituito da, le località o aree sono situate;
f) la concatenazione, essendo non meno di sette o più di 35 caratteri di lunghezza, di:
- un codice di emissione ISO/IEC 15459;
- un codice di località, costituito da caratteri tratti dal set {A-Z; 0-9} che si accorda con le specifiche dell'agenzia di emissione interessata.

