Identificatore di Attrezzatura, essendo un identificatore univoco a livello globale per un dispositivo, un articolo di attrezzatura o un'istanza di un'applicazione informatica utilizzata nella produzione, trasporto, elaborazione o altro trattamento di articoli, che è costruito concatenando:
 - un codice dell'agenzia di emissione ISO/IEC 15459;
 - un numero di attrezzatura che si conforma alle specifiche dell'agenzia di emissione interessata; e che:
 - comprende solo caratteri alfanumerici maiuscoli e/o numerici;
 - è unico (cioè, è distinto da qualsiasi altro identificatore conforme a ISO/IEC 15459) all'interno del dominio dell'agenzia di emissione;
 - non può essere derivato da qualsiasi altro identificatore conforme a ISO/IEC 15459, emesso sotto la stessa agenzia di emissione, mediante l'aggiunta semplice di caratteri a, o la loro rimozione da, la sua fine.
ID Lettore.
Identificatore di attrezzatura, essendo un identificatore univoco a livello globale per un dispositivo, un articolo di attrezzatura o un'istanza di un'applicazione informatica utilizzata nella produzione, trasporto, elaborazione o altro trattamento di articoli.

Codice di Località UPU, essendo un codice che identifica una località o un'area geografica, o un gruppo associato di tali località o aree, che ha rilevanza per una transazione correlata e che si conforma a una delle strutture definite in a) a g) di seguito:
a) due caratteri alfabetici maiuscoli corrispondenti al codice di paese ISO 3166-1 alpha-2 del paese in cui, o costituito da, le località o aree sono situate;
b) tre caratteri alfabetici maiuscoli corrispondenti al codice IATA dell'aeroporto o della città in, vicino a, o costituito da, le località o aree sono situate;
c) quattro o più caratteri di cui i primi tre corrispondono a un codice di paese ISO 3166-1 seguito da un trattino (-), con il saldo essendo un codice postale nel paese interessato;
d) quattro o più caratteri di cui i primi tre corrispondono a un codice di paese ISO 3166-1 seguito da un punto (.), con il saldo essendo un codice di suddivisione di paese ISO 3166-2 nel paese interessato;
e) cinque caratteri alfabetici maiuscoli corrispondenti al codice UN/LOCODE dell'area in, vicino a, o costituito da, le località o aree sono situate;
f) sei caratteri alfanumerici maiuscoli corrispondenti a un codice IMPC UPU assegnato in conformità con lo standard UPU S34;
g) la concatenazione, non inferiore a sette né superiore a 25 caratteri in lunghezza, di:
 - un codice emittente assegnato in conformità con gli standard UPU S31;
 - un codice di località, costituito da caratteri tratti dal set {A-Z; 0-9} che si conforma alle specifiche dell'emittente interessato.

Targa con Dati del Servizio e Codice di Località è una struttura dati composta, conforme alla specifica nello standard UPU S25, che include la specificazione di:
 - un identificatore di articolo conforme a ISO/IEC 15459;
 - una specifica conforme all'identificatore di dati 5U del servizio da fornire rispetto all'articolo;
 - un codice di località UPU conforme all'identificatore di dati 17U o un codice di località UPU qualificato conforme all'identificatore di dati 18U.
 Nota - Per ulteriori dettagli, fare riferimento allo standard UPU S25. La distinzione tra un semplice codice di località UPU (DI 17U) e un codice di località UPU qualificato (DI 18U) può essere determinata dal primo carattere. Se questo è numerico, si applica 18U; se è alfabetico, si applica 17U.

