Data, rappresentata in forma modificata conforme a UTC:
yyyy[mm[dd[hh[mm[ss[fff]]]]]][poooo] dove le parentesi quadre indicano l'opzionalità e yyyy è l'anno, mmdd il mese e il giorno, hhmmss l'ora del giorno in ore minuti e secondi, fff le frazioni di sezioni e poooo l'offset da UTC espresso in ore e minuti, l'offset essendo positivo se p è un punto (.), negativo se P è un segno meno (-).
ESEMPIO:
2005 - (UTC) anno calendario 2005;
200505 - (UTC) mese calendario Maggio 2005;
20050518 - (UTC) 18 Maggio 2005;
200505181247 - 12:47 UTC il 18 Maggio 2005;
200505181247.0100 - 12:47 ora locale, essendo 11:47 UTC, il 18 Maggio 2005;
20050518124723099 - 99 millisecondi dopo le 12:47:23 UTC il 18 Maggio 2005.

Data Qualificata, composta dalla concatenazione di:
- un codice dell'agenzia emittente ISO/IEC 15459;
- un qualificatore di data conforme alle specifiche di tale agenzia emittente;
- una data il cui formato e interpretazione sono conformi alle specifiche dell'agenzia emittente per quel qualificatore di data.

Dichiarazione di Categoria Materiale di Imballaggio*, Codice* e Peso per un dato materiale di imballaggio utilizzato in un dato imballaggio secondo la direttiva UE sui rifiuti di imballaggio e imballaggi. (Categoria materiale e codice definiti in Allegato M).
12ECCMMMMMMNNNNNUU dove: - '12E' (an3) è l'Identificatore di Dati;
 - 'CC' (n2) è la Categoria Materiale secondo Allegato M;
 - 'MMMMMM' (an1...6) è il Codice Materiale secondo Allegato M;
 - 'NNNNN' (n5) Peso Materiale, inclusa la virgola decimale (ad es., 12,12);
 - 'UU' (an2) è l'Unità di misura per il peso (ad es., KG, GR, LB o OZ secondo ANSI X12.3 come in Allegato D).

