Numero del Destinatario.
Il numero identificativo unico può essere l'IRS, EIN, SSN o il numero assegnato da CBP, come richiesto sulla Filing di Sicurezza. Solo i seguenti formati devono essere utilizzati: IRS EIN: NN-NNNNNNN;
IRS EIN w/ suffisso:
NN-NNNNNNNXX;
SSN: NNN-NN-NNNN;
Numero assegnato da CBP: YYDDPP-NNNNN.
